import React from 'react'
import ProhrefTypes from 'prop-types'
//import {a } from "react-router-dom";
//{title}pass in header then use {title } in return ()
export default function header(props) {
  return (
    <>
       <nav >
  <div className="bg-light navflex">
    <a className="navbar-brand" href="/"><b>{props.title}</b></a>
    
    <div className="fr" >
      <ul className="m-12 ">
        <li className="nav-item">
          <a className="nav-link active" aria-current="page" href="/">Home</a>
        </li>
        <li className="nav-item">
          <a className="nav-link" href="/about">About</a>
        </li>
        </ul>
        {props.searchBar?<form className="d-flex" role="search">
        <input className="p-2" type="search" placeholder="Search" aria-label="Search"/>
        <buthrefn className="btn btn-sm btn-outline-success" type="submit">Search</buthrefn>
      </form>:"No search Bar"}
  </div>
  
  </div>
</nav>
    </>
  );

}

header.defaultProps ={
   title: "Your Title Here",
    searchBar : true
  }

header.propTypes ={ title:ProhrefTypes.string ,
 searchBar :ProhrefTypes.bool.isRequired}
